 simultaneously and is used by the UCSC Genome Browser.');INSERT INTO file_format VALUES ('5','CONTIG','the CONTIG format is a direct output from the SOAPdenovo alignment program.');INSERT INTO file_format VALUES ('6','EXCEL','Microsoft spreadsheet format.');INSERT INTO file_format VALUES ('7','FASTA','FASTA is a text based format for representing either nucleotide sequences or peptide sequences.');INSERT INTO file_format VALUES ('8','FASTQ','the FASTQ format stores sequences (usually nucleotide sequence) and Phred qualities in a single file.');INSERT INTO file_format VALUES ('9','GFF','The General Feature Format (GFF) is used for describing genes and other features of DNA, RNA and protein sequences.');INSERT INTO file_format VALUES ('10','IPR','the Web Gene Ontology (WEGO) Annotation format consists of the protein ID, followed by column(s) that are the IPR (InterPro) ID(s).');INSERT INTO file_format VALUES ('11','KEGG','the Web Gene Ontology (WEGO) Annotation format consists of the protein ID, followed by column(s) that are the KEGG (Kyoto Encyclopedia of Genes and Genomes) ID(s).');INSERT INTO file_format VALUES ('12','MAF','the Multiple Alignment Format (MAF) stores a series of multiple alignments at the DNA level between entire genomes.');INSERT INTO file_format VALUES ('13','NET','the NET file format is used to describe the axtNet data that underlie the net alignment annotations in the UCSC Genome Browser.');INSERT INTO file_format VALUES ('14','PDF','Portable Document Format.');INSERT INTO file_format VALUES ('15','PNG','Portable Network Graphics.');INSERT INTO file_format VALUES ('16','QUAL','base quality score file for NextGen data (similar in format to fasta).');INSERT INTO file_format VALUES ('17','QMAP','QMAP files are generated for methylation data from an internal BGI pipeline.');INSERT INTO file_format VALUES ('18','RPKM','Gene expression levels are calculated by Reads Per Kilobase per Million (RPKM) mapped reads.');INSERT INTO file_format VALUES ('19','SAM','the Sequence Alignment/Map (SAM) format is a TAB delimited text format consisting of a header section, which is optional, and an alignment section.');INSERT INTO file_format VALUES ('20','TAR','an archive containing other files.');INSERT INTO file_format VALUES ('21','TEXT','a text file.');INSERT INTO file_format VALUES ('22','VCF','the Variant Call Format (VCF) is a text file format for representing eg SNPs, InDels, CNVs, SVs, microsatellites, genotypes.');INSERT INTO file_format VALUES ('23','WEGO','the Web Gene Ontology (WEGO) Annotation format consists of the protein ID, followed by column(s) that are the GO ID(s).');INSERT INTO file_format VALUES ('24','WIG','the output file from TopHat is a UCSC wigglegram of alignment coverage.');INSERT INTO file_format VALUES ('25','UNKNOWN','unknown file type');INSERT INTO gigadb_user VALUES ('1','guoxs@genomics.cn','123','Xiaoshen','Guo','BGI');INSERT INTO gigadb_user VALUES ('2','baiyq@genomics.cn','123','Yinqi','Bai','BGI');INSERT INTO gigadb_user VALUES ('3','xuxun@genomics.cn','123','Xun','Xu','BGI');INSERT INTO gigadb_user VALUES ('4','huangsanwen@caas.net.cn','123','Sanwen','Huang','CAAS');INSERT INTO gigadb_user VALUES ('5','qinjj@genomics.org.cn','123','Junjie','Qin','BGI');INSERT INTO gigadb_user VALUES ('6','fangxd@genomics.org.cn','123','Xiaodong','Fang','BGI');INSERT INTO gigadb_user VALUES ('7','chenwenbin@genomics.cn','123','Wenbin','Chen','BGI');INSERT INTO gigadb_user VALUES ('8','libo@genomics.cn','123','Bo','Li','BGI');INSERT INTO gigadb_user VALUES ('9','yanzengli@genomics.cn','123','Zengli','Yan','BGI');INSERT INTO gigadb_user VALUES ('10','Brian.Dalrymple@csiro.au','123','Brian','Dalrymple','CSIRO Livestock Industries');INSERT INTO gigadb_user VALUES ('11','JingHC@genomics.org.cn','123','Bing','He','BGI');INSERT INTO gigadb_user VALUES ('12','liuxin@genomics.cn','123','Xin','Liu','BGI');INSERT INTO gigadb_user VALUES ('13','zhanggj@genomics.cn','123','Guojie','