an based on uniparental markers and SNP chip data are over simplistic"');INSERT INTO sample VALUES ('2','1','');INSERT INTO sample VALUES ('3','2','');INSERT INTO sample VALUES ('4','3','');INSERT INTO sample VALUES ('5','4','');INSERT INTO sample VALUES ('6','5','');INSERT INTO sample VALUES ('7','6','');INSERT INTO sample VALUES ('8','7','');INSERT INTO sample VALUES ('9','8','');INSERT INTO sample VALUES ('10','9','');INSERT INTO sample VALUES ('11','25','disease=DOID:684');INSERT INTO sample VALUES ('12','10','');INSERT INTO sample VALUES ('13','11','age="3 year",sex="female",tissue="peripheral blood",description="We sequenced a 3-year old female panda named Jingjing, who came from the Chengdu Research Base of Giant Panda Breeding and was chosen as the model of 2008 Olympic Mascot. The captive breeding of pandas follows principles meant to maintain genetic polymorphism, so it is difficult to find a homozygous panda because mating of close relatives is not allowed. The genetic background of Jingjing’s father comes solely from pandas in the Liangshan Mountain, and Jingjing’s mother’s genetic background has half from pandas in the Liangshan Mountain and half from the Minshan Mountain. Liangshan and Minshan are the two major locations of wild giant pandas. So Jingjing is a relatively good candidate for sequencing."');INSERT INTO sample VALUES ('14','12','');INSERT INTO sample VALUES ('15','13','');INSERT INTO sample VALUES ('16','14','');INSERT INTO sample VALUES ('17','15','');INSERT INTO sample VALUES ('18','16','');INSERT INTO sample VALUES ('19','25','sex="male",tissue="hair",country="Greenland: Saqqaq Culture site Qeqertasussuk, north-western Greenland",sample age="4100-3900 cal. YrBP",description="ancient human hair tufts excavated directly from culturally deposited permafrozen sediments at Qeqertasussuk, Greenland"');INSERT INTO sample VALUES ('20','17','description="We sequenced the S. haematobium genome from 200 ng of genomic DNA template