t anyone the right to use this work for any purpose, without any conditions, unless such conditions are required by law.','Unknown','Wonx2150, Wikipedia');INSERT INTO image VALUES ('21','100024_Bombyx_mori.jpg','Domestic and wild silkworms','http://eol.org/pages/48480/overview','GNU Free Documentation License, CC SA','Gerd A.T. Müller','Wikimedia Commons');INSERT INTO image VALUES ('22','100027_Pantholops_hodgsonii.jpg','Tibetan antelope','http://en.wikipedia.org/wiki/File:Tibetan_antelope.jpg','CC Attribution 2.0 Generic','B_cool','Flickr');INSERT INTO image VALUES ('23','100012_Sorghum_bicolor.jpg','Sorghum bicolor','http://eol.org/pages/1115166/overview','CC BY','Forest & Kim Starr','BioLib.cz');INSERT INTO image VALUES ('24','100030_Crassostrea_gigas.jpg','Pacific oyster','http://en.wikipedia.org/wiki/File:Crassostrea_gigas_p1040847.jpg','GNU Free Documentation License, CC-SA','David Monniaux','Wikimedia Commons');INSERT INTO image VALUES ('25','100016_Solanum.jpg','Potato','http://commons.wikimedia.org/wiki/File:Patates.jpg','Public Domain, US Government (USDA)','Scott Bauer','www.ars.usda.gov Image Number K9152-1');INSERT INTO image VALUES ('26','100022_Heterocephalus_glaber.jpg','Naked mole rat','http://commons.wikimedia.org/wiki/File:Naked_Mole_Rat_Eating.jpg','I, the copyright holder of this work, release this work into the public domain. I grant anyone the right to use this work for any purpose, without any conditions, unless such conditions are required by law.','Ltshears - Trisha M Shears','Own work');INSERT INTO image VALUES ('27','100013_YH.jpg','Han Chinese individual','http://commons.wikimedia.org/wiki/File:Emperor_Gaozu_of_Han.jpg','public domain because its copyright has expired','Unknown','Wikimedia Commons, en:Image:HanGaozu.jpg');INSERT INTO image VALUES ('28','100020_Setaria_italica.jpg','Foxtail millet','http://eol.org/pages/1114673/overview','GNU Free Documentation License, CC SA','Markus Hagenlocher','Wikimedia Commons');INSERT INTO image VALUES ('29','100034_Hepatocellular_carcinoma.jpg','Hepatocellular carcinoma','http://commons.wikimedia.org/wiki/File:Hepatocellular_carcinoma_intermed_mag.jpg','Creative Commons Attribution-Share Alike 3.0 Unported license, GNU Free Documentation License, Version 1.2 or any later version','Nephron','own work, Wikimedia Commons');INSERT INTO image VALUES ('30','100011_Acromyrmex_echinatior.jpg','Leaf-cutting ant','http://commons.wikimedia.org/wiki/File:Leaf-cutter_ant.png','the content of all PLoS journals is published under the Creative Commons Attribution 2.5 license','Scott Bauer, US Department of Agriculture','Restoring Nature\'s Backbone. Nicholls H, PLoS Biology Vol. 4/6/2006, e202 http://dx.doi.org/10.1371/journal.pbio.0040202');INSERT INTO publisher VALUES ('1','GigaScience','');INSERT INTO publisher VALUES ('2','BGI Shenzhen','');INSERT INTO dataset VALUES ('1','1','1','10.5524/100010','Genomic sequence from an Aboriginal Australian. ','Here we present Aboriginal Australian (<em>Homo sapiens</em>) genomic sequence obtained from a 100-year-old lock of hair donated by an Aboriginal man from southern Western Australia in the early 20th century.\n\nThe nuclear genome was sequenced to an overall depth of 6.4-fold.  It had a high degree of fragmentation, but no genotype level evidence of sample contamination by DNA from sample handlers of European descent was detected.  Over 2 million SNPs were identified after genome mapping and genotyping, approximately 6 percent of which were not previously reported.  The mitochondrial genome (mtDNA) was sequenced to an average depth of 338x and found to belong to a new subclade of haplogroup O.','216895848448','ftp://climb.genomics.cn/pub/10.5524/100001_101000/100010/','Published','GigaDBUploadForm_Aboriginal.xls','541dc3bd456b6bb5a2904d288452f15e','11/12/2011','05/31/2012','1');INSERT INTO dataset VALUES ('2','13','2','10.5524/100006','Genomic data from Adelie penguin (<em>Pygoscelis adeliae</em>). ','The Adelie penguin (<em>Pygoscelis adeliae</em>) is an iconic penguin of moderate stature and a tuxedo of black and white feathers.  The penguins are only found in the Antarctic region and surrounding islands.  Being very sensitive to climate change, and due to changes in their behavior based on minor shifts in climate, they are often used as a barometer of the Antarctic.\n\nWith its status as one of the adorable and cuddly flightless birds of Antarctica, they serve as a sticking point for conservationists, even though they are as of now low risk for endangerment.  The sequence of the penguin can be of use in understanding the genetic underpinnings of its evolutionary traits and adaptation to its extreme environment; its unique system of feathers; its prowess as a diver; and its sensitivity to climate change.  We hope that this genome data will further our understanding of one of the most remarkable creatures to waddle the planet Earth.','397284474','ftp://climb.genomics.cn/pub/10.5524/100001_101000/100006/','Published','GigaDBUploadForm_AdeliePenguin.xls','e1643c80e12fec311c330b06a5647a93','07/06/2011','05/31/2012','1');INSERT INTO dataset VALUES ('3','2','3','10.5524/100021','Genomic data from Chinese cabbage (<em>Brassica rapa</em>). ','Available here is genomic data for the polyploid plant <em>Brassica rapa</em> ssp. pekinensis line Chiifu-401-42, a Chinese cabbage.  As there are several oil and vegetable crop species in the Brassica family, this genome is of great agricultural relevance.  It also provides an important resource for studying the evolution of polyploid genomes.\n\nThe <em>Brassica rapa</em> Genome Sequencing Project Consortium assembled a 283.8 Mb genome estimated to cover >98% of the gene space.  Using 72X coverage of paired short read sequences generated by Illumina GA II technology and 199,452 BAC-end sequences, 159 super scaffolds were produced, representing 90% of the assembled sequences with an N50 scaffold size of 1.97 Mb.  Using genetic mapping of 1,427 markers in <em>B. rapa</em>, ten pseudo chromosomes that included 90% of the assembly were produced.  A total of 41,174 protein-coding genes in the <em>B. rapa</em> genome were modeled, and the genome was found to have undergone genome triplication.','708669603','ftp://climb.genomics.cn/pub/10.5524/100001_101000/100021/','Published','GigaDBUploadForm_Cabbage.xls','7c6383b47d5932a402561cbbcb8afc55','11/12/2011','05/31/2012','1');INSERT INTO dataset VALUES ('4','3','4','10.5524/100009','The genomic sequence of the Chinese hamster ovary (CHO) K1 cell line (<em>Cricetulus griseus</em>). ','Chinese hamster ovary (CHO) K1 cells are a cell line cultured from the ovary of the Chinese hamster (<em>Cricetulus griseus</em>).  CHO cells are often used in biological and medical studies and commercially in the production of therapeutic proteins, which contribute significantly to the $100 billion biopharmaceutical market.\n\nBGI sequenced the CHO K1 genome genome using next-generation sequencing technology, assembling a 2.45G genome with 24,383 predicted genes.','805306368','ftp://climb.genomics.cn/pub/10.5524/100001_101000/100009/','Published','GigaDBUploadForm_CHO-K1.xls','73fe7204e67dee2fcaff8afc024b14fc','07/20/2011','05/31/2012','1');INSERT INTO dataset VALUES ('5','13','15','10.5524/100008','Genomic data from the polar bear (<em>Ursus maritimus</em>).','The polar bear (<em>Ursus maritimus</em>) is one of the largest land carnivores, second only to the Alaskan brown bear.  In an effort to adapt to the extremely cold Arctic environment, it has evolved many unique characteristics.  However, ecological pressures pose a grave threat to the survival of polar bears.  The polar bear genome provides significant contributions to research concerning evolution, biodiversity and climate change.\n\nIn 2010, the BGI completed the first draft of the genome sequence of a 25 years old male polar bear.  Using next-generation sequencing technology (Illumina GA) to obtain about 101-fold genome coverage, and SOAPdenovo, the self-developed short reads assembly method, a high quality draft genome sequence was assembled with an N50 scaffold size of 15.9 megabases (Mb), and function elements annotation was finished.  A reference gene set that contained around 21,000 genes for the polar bear was predicted.  The transposable elements comprised approximately 37% of the polar bear genome.','332859965','ftp://climb.genomics.cn/pub/10.5524/100001_101000/100008/','Published','GigaDBUploadForm_PolarBear.xls','ddc054198612c54b6ea68d1397d59284','07/06/2011','05/31/2012','1');INSERT INTO dataset VALUES ('6','13','5','10.5524/100003','Genomic data from the crab-eating macaque/cynomolgus monkey (<em>Macaca fascicularis</em>).','The crab-eating macaque (<em>Macaca fascicularis</em>), also known as the Java macaque or long-tailed macaque, is a species of primate located throughout Southeast Asia.  Due to the frequent usage of the genus <em>Macaca</em> in scientific research, the sequence the crab-eating macaque furthers our understanding on how it differs from other macaque species, like the Chinese rhesus macaque and the Indian rhesus macaque.  This is especially relevant considering the recent trend of using crab-eating macaque (CE) and Chinese rhesus macaques rather than the Indian rhesus macaque as laboratory models.\n\nThe DNA sample for genome sequencing and analyses was from a female CE that was a captive-bred descendent of a CE from Vietnam.  The genome was sequenced on the IlluminaGAIIx platform, and we obtained 162-Gb of high-quality sequence, representing 54-fold coverage.  The sequencing data were processed with Illumina custom computational pipelines. The genome was <em>de novo</em> assembled using SOAPdenovo program based on the de Bruijn graph algorithm methods.  The total size of the assembled genome was about 2.85 Gb, providing 54-fold coverage on average.  The scaffolds were assigned to the chromosomes according to the synteny displayed with the Indian rhesus macaque and human genome sequences.  About 92% of the CE scaffolds could be placed onto chromosomes.','2770253905','ftp://climb.genomics.cn/pub/10.5524/100001_101000/100003/','Published','GigaDBUploadForm_CrabEatingMacaque.xls','7cbf108d06b08191dc85eb026a1fa70a','07/06/2011','05/31/2012','1');INSERT INTO dataset VALUES ('7','4','6','10.5524/100025','Genomic data for the domestic cucumber (<em>Cucumis sativus var. sativus L.</em>). ','Here we present genomic data for the domestic cucumber (<em>Cucumis sativus var. sativus L.</em>).  The cucumber is a member of the Cucurbitaceae or cucurbit family, a family of great agricultural and horticultural importance that also includes species such as melons, gourds and squashes.  A biologically interesting as well as an economically relevant species, it is used as a model system for plant sex determination and vascular biology studies.\n\nThe domestic cucumber has seven pairs of chromosomes and a haploid genome of 367 Mb, a smaller genome for the Cucurbitaceae family.  The genome was sequenced and assembled with N50 contig and scaffold sizes of 19.8 Kb and 1.14 Mb, respectively.  Using the genetic map, 72.8% of the assembled sequences were anchored onto the 7 chromosomes.  A total of 26,682 genes were predicted in the current cucumber genome.','805306368','ftp://climb.genomics.cn/pub/10.5524/100001_101000/100025/','Published','GigaDBUploadForm_Cucumber.xls','e19a0acdf3ff5d156635701f1bb3c870','11/12/2011','05/31/2012','1');INSERT INTO dataset VALUES ('8','5','7','10.5524/100001','Genomic data from <em>Escherichia coli</em> O104:H4 isolate TY-2482','The May 2011 outbreak of an <em>E. coli</em> infection in Europe resulted in serious concerns about the potential appearance of a new deadly strain of bacteria, <em>Escherichia coli</em> O104:H4 TY-2482.  In response to this situation, and immediately after the reports of deaths, the University Medical Centre Hamburg-Eppendorf and BGI-Shenzhen worked together to sequence the bacterium and assess its human health risk.\n\nThe bacterium’s genome was first sequenced using Life Technologies; Ion Torrent sequencing platform. According to the results of the draft assembly, the estimated genome size of this new <em>E. coli</em> strain is about 5.2 Mb.  Sequence analysis indicated this bacterium is an EHEC serotype O104 <em>E. coli</em> strain.  Comparative analysis showed that this bacterium has 93% sequence similarity with the EAEC 55989 <em>E. coli</em> strain, which was isolated in the Central African Republic and known to cause serious diarrhea.  This strain of <em>E. coli</em>, however, has also acquired specific sequences that appear to be similar to those involved in the pathogenicity of hemorrhagic colitis and hemolytic-uremic syndrome.  The acquisition of these genes may have occurred through horizontal gene transfer.\n\nTo maximize its utility to the research community and aid those fighting the epidemic, this genomic data was released into the public domain under a <a href="http://creativecommons.org/about/cc0">CC0 license</a>.\n\nTo the extent possible under law, <a href ="http://www.genomics.cn/">BGI Shenzhen</a>  has waived all copyright and related or neighboring rights to genomic data from the 2011 <em>E. coli</em> outbreak. This work is published from: China.','1717986918','ftp://climb.genomics.cn/pub/10.5524/100001_101000/100001/','Published','GigaDBUploadForm_Ecoli.xls','b2526703f42be697a9a633ff3c8615d0','06/03/2011','05/31/2012','2');INSERT INTO dataset VALUES ('9','13','8','10.5524/100005','Genomic data from the Emperor penguin (<em>Aptenodytes forsteri</em>).','The Emperor penguin (<em>Aptenodytes forsteri</em>) is a large penguin, standing over 1 meter tall, with distinctive black, yellow and white markings.  Like most penguins, the emperor penguins are indigenous to Antarctica and exist between the 66th and 78th parallels.\n\nFamous for its unique social and reproductive behavior, the emperor penguin also possesses a number of other notable evolutionary qualities: its stature, its feathers, its incubation process, and its swimming capabilities.  The <em>Aptenodytes forsteri</em> genome offers new insights into this remarkable bird.','397284474','ftp://climb.genomics.cn/pub/10.5524/100001_101000/100005/','Published','GigaDBUploadForm_EmperorPenguin.xls','562f5aa56a38b526383a2e1ca9138495','07/06/2011','05/31/2012','1');INSERT INTO dataset VALUES ('10','13','9','10.5524/100018','Genome data from the Florida carpenter ant (<em>Camponotus floridanus</em>).','Here we present the sequenced genome of the Florida carpenter ant (<em>Camponotus floridanus</em>), a species with an organized caste society.  As an eusocial species, its genome offers interesting insights into aging, epigenetics and animal behavior.\n\nThe Illumina Genome Analyzer platform was used to sequence a genomic library of the Florida carpenter ant, obtaining more than 100-fold coverage.  The draft genomic assembly reached a scaffold N50 size of ~600 kb and covers more than 90% of the approximately 240 Mb genome.','75161927','ftp://climb.genomics.cn/pub/10.5524/100001_101000/100018/','Published','GigaDBUploadForm_FloridaCarpenterAnt.xls','04d2ff7efa387900f0781faa47ff1524','11/12/2011','05/31/2012','1');INSERT INTO dataset VALUES ('11','13','10','10.5524/100019','Genome data from Jerdon’s jumping ant (<em>Harpegnathos saltator</em>). ','Presented here is the sequenced genome of Jerdon’s jumping ant (<em>Harpegnathos saltator</em>).  The jumping ant has a distinct caste and social behavior system, and its genome offers interesting insights into epigenetics in aging and behavior.\n\nThe Illumina Genome Analyzer platform was used to sequence a genomic library, obtaining more than 100-fold coverage of the estimated 330 Mb genome.  The draft genomic assembly reached a scaffold N50 size of ~600 kb and covers more than 90% of the ant’s genome.','1009317314','ftp://climb.genomics.cn/pub/10.5524/100001_101000/100019/','Published','GigaDBUploadForm_JerdonsJumpingAnt.xls','a58031cee238f8c536cfb9e682612296','11/12/2011','05/31/2012','1');INSERT INTO dataset VALUES ('12','6','11','10.5524/100031','Genomic data from the Wuzhishan inbred pig (<em>Sus scrofa</em>). ','The pig (<em>Sus scrofa</em>) is an economically important food source and also serves as an important model organism.  Here we present the sequence of one male inbred Wuzhishan pig (WZSP) at generation F20.  DNA was extracted from the ear of this species.  We applied a whole genome shotgun strategy and next-generation sequencing technologies using Illumina HiSeq 2000 for sequencing, in total 340.53Gb of raw data were generated and 210.79Gb high quality data were used for assembly.  The assembly result of WZSP was 2.6 Gbp, and the N50 size of contigs and scaffolds were 23.5 Kbp and 5.4 Mbp, respectively.  38% of the genome was identified as repeats and 20,326 genes were identified from homolog prediction.','293131517952','ftp://climb.genomics.cn/pub/10.5524/100001_101000/100031/','Published','GigaDBUploadForm_MiniPig.xls','31f5524c59a739d57b850c65d1773e7f','05/03/2012','05/31/2012','1');INSERT INTO dataset VALUES ('13','13','12','10.5524/100004','Genomic data from the giant panda (<em>Ailuropoda melanoleuca</em>). ','The giant panda (<em>Ailuropoda melanoleuca</em>) is considered a symbol of China and is a much loved animal all around the world.  It is also one of the world’s most endangered species, making it a flagship species for conservation efforts.  As the first fully sequenced Ursidae and the second fully sequenced carnivore after the dog, the whole genome sequence and annotation data provide an unparalleled amount of information to aid in understanding the genetic and biological underpinnings of this unique species, and will help contribute to disease control and conservation efforts.\n\nIn 2008, BGI completed a first draft of the genome sequence of a three-year old female giant panda named Jingjing, who was used as a model for the 2008 Olympics in Beijing, China (<a href="http://dx.doi.org/10.1038/nature08696">doi: 10.1038/nature08696</a>). Using second-generation Illumina GA sequencing data, the first de novo genome assembly was created using short-read sequencing technology.  Here you will find the giant panda genome sequence assembly as well as annotation information, such as gene structure and function, non-coding RNAs, and repeat elements.  Also presented are polymorphism information detected in the diploid genome, including SNPs, indels, and structural variations (SVs).  The assembly was done using SOAPdenovo software and the panda genome data is visualized via MapView, which is powered by the Google Web Toolkit.','165356240896','ftp://climb.genomics.cn/pub/10.5524/100001_101000/100004/','Published','GigaDBUploadForm_Panda.xls','eb1574a47e1cb972dbdd18687d857e66','07/06/2011','05/31/2012','1');INSERT INTO dataset VALUES ('14','13','13','10.5524/100007','Genomic data from the domestic pigeon (<em>Columba livia</em>).','The domestic pigeon (<em>Columba livia domestica</em>) is one of the most common birds on planet Earth, located on every continent besides Antarctica.  The sub-species sequenced was a breed known as the Danish Tumbler, a show pigeon with a distinct color markings.\n\nThe domestic pigeon genome sequence provides a better understanding of such a widespread creature, including certain mechanisms that scientists still fail to understand fully, such as the magnetosensitivity.  The sequencing data also presents insight into the species’ similarities to and differences from other birds, and to how breeding might have shaped its genome as this sub-species was taken from Asian colonies to Denmark 400 years ago and selectively bred.\n\nIn 2010, BGI used the whole genome shotgun sequencing and IlluminaHiseq 2000 system to generate 98X short reads for a Danish Tumbler.  The raw data was then used by the assembler SOAPdenovo to produce a draft assembly of 1.1Gb with N50 scaffold length of 3.1Mb and N50 contig length of 22.4kb.  Based on the k-mer distribution of sequencing data, the genome size of <em>Columba livia</em> is estimated to be 1.3G, suggesting the current assembly is about 84% complete.  The percentage of GC content (41.5%) and the percentage of repetitive content (8.7%) in the pigeon are also similar in nature to three other avian genomes (chicken, zebra finch, turkey); the uncovered regions of the genome appear to be enriched in repeats.  A total of 17,300 protein-coding genes are predicted in the assembly.','332859965','ftp://climb.genomics.cn/pub/10.5524/100001_101000/100007/','Published','GigaDBUploadForm_Pigeon.xls','b53d95fb7acc779477d6a0c76335dce0','07/06/2011','05/31/2012','1');INSERT INTO dataset VALUES ('15','7','14','10.5524/100028','Genomic data from the pigeonpea (<em>Cajanus cajan</em>). ','Here we present the genome of the pigeonpea (<em>Cajanus cajan</em>), a widely farmed diploid legume species.  It is an important reference genome for food crop development as many crop species, such as soybean (<em>Glycine max</em>), chickpea (<em>Cicer arietinum</em>), lentil (<em>Lens culinaris</em>), and alfalfa (<em>Medicago sativa</em>), are legumes.  The genetic improvement of pigeonpea has ramifications for food protection as well, as it is cultivated primarily in small-scale holdings in semi-arid tropical regions of the developing world.\n\nThe 237.2 Gb of sequence were generated using the Illumina next-generation sequencing platform to generate.  Scaffolds representing 72.7% (605.78 Mb) of the 833.07-Mb pigeonpea genome were assembled using the Illumina sequence and Sanger-based bacterial artificial chromosome end sequences and a genetic map.  A few segmental duplication events, but no recent genome-wide duplication events, are observable.','204010946','ftp://climb.genomics.cn/pub/10.5524/100001_101000/100028/','Published','GigaDBUploadForm_PigeonPea.xls','fe9118db53e181ae19d9210c7e76df6b','11/12/2011','05/31/2012','1');INSERT INTO dataset VALUES ('16','13','26','10.5524/100022','Genome sequence of the naked mole rat (<em>Heterocephalus glaber</em>).','Here is the genome of the naked mole rat (<em>Heterocephalus glaber</em>), one of the only two known eusocial mammals.  It is a fascinating species, due not only to its unique behavior but also to its unique physiology.  Among its unusual characteristics, it has the longest lifespan of all rodent species, is a poikilotherm, is highly resistant to cancer, and does not sense certain types of pain.\n\nThe genome of an individual male naked mole rat was sequenced on the Illumina HiSeq 2000 platform and assembled using SOAPdenovo.  In assembly 2.5 Gb (gigabase pairs) contig sequences with N50 19.3 kb (kilobase pairs) and N90 4.7 kb, and 2.7 Gb scaffold sequences with N50 1.6 Mb (megabase pairs) and N90 0.3 Mb was obtained.','81604378624','ftp://climb.genomics.cn/pub/10.5524/100001_101000/100022/','Published','GigaDBUploadForm_NakedMoleRat.xls','95fecef3c10895162c0859e631d49c9a','11/12/2011','05/31/2012','1');INSERT INTO dataset VALUES ('17','13','16','10.5524/100002','Genomic data from the Chinese Rhesus macaque (<em>Macaca mulatta lasiota</em>). ','The Chinese rhesus macaque (<em>Macaca mulatta lasiota</em>) is a subspecies of rhesus macaques that mainly resides in western and central China.  Due to their anatomical and physiological similarity with human beings, macaques are a common laboratory model.  Also, as several macaques species have been sequenced, such as the Indian rhesus macaque and the crab-eating macaque, examination of the Chinese rhesus macaque (CR) genome offers interesting insights into the entire <em>Macaca</em> genus.\n\nThe DNA sample for data sequencing and analyses was obtained from a five-year old female CR from southwestern China.  The genome was sequenced on the IlluminaGAIIx platform, from which 142-Gb of high-quality sequence, representing 47-fold genome coverage for CR.  The total size of the assembled CR genome was about 2.84 Gb, providing 47-fold on average.  Scaffolds were assigned to the chromosomes according to the synteny displayed with the Indian rhesus macaque and human genome sequences.  About 97% of the CR scaffolds could be placed onto chromosomes.','1127428915','ftp://climb.genomics.cn/pub/10.5524/100001_101000/100002/','Published','GigaDBUploadForm_RhesusMacaque.xls','396e73a939307421aec6e54d6cf3d41b','07/06/2011','05/31/2012','1');INSERT INTO dataset VALUES ('18','8','17','10.5524/100017','Genomic data from the roundworm <em>Ascaris suum</em>.','Available here is the draft genome for <em>Ascaris suum</em>, a roundworm species that infects pigs.  It is a valuable resource for therapy and diagnostic test development for both <em>Ascaris suum</em> infection of pigs, and also human infection by the closely related species <em>A. lumbricoides</em>.\n\nThe <em>A. suum</em> genome was sequenced at ~80-fold coverage to generate an approximately 273 million base genome sequence encoding 18,542 protein-coding genes.  Compared to other metazoan genomes, it has low repeat content (4.4%). Compared with other parasitic free-living roundworms and <em>C. elegan</em>, <em>A. suum</em> shares the highest homology with <em>Brugia malayi</em>, another animal parasite.  The <em>A. suum</em> secretome (consisting of around 750 molecules) is rich in peptidases linked to the penetration and degradation of host tissue, and an assemblage of molecules likely to modulate or evade host immune responses.  This genome provides a comprehensive resource to the scientific community and a foundation for developing new and urgently needed therapeutic intervention drugs, vaccines and diagnostic tests) against ascariasis and other nematodiases.','107374182','ftp://climb.genomics.cn/pub/10.5524/100001_101000/100017/','Published','GigaDBUploadForm_Roundworm.xls','c8252af843f2bf39b53daf9098f1d618','11/12/2011','05/31/2012','1');INSERT INTO dataset VALUES ('19','1','18','10.5524/100026','Genomic data from an extinct Palaeo-Eskimo. ','Available here is the genome of a male individual from an extinct Palaeo-Eskimo culture, the first known group of <em>Homo sapiens</em> to settle in Greenland.\n\nThe DNA sample was obtained from ~4,000-year-old permafrost-preserved hair, and was shown to have very low modern DNA contamination.  The diploid genome was sequenced to an average depth of 20x using Illumina GAII sequencing platforms, with 79% recovery.  Correct indexed reads were mapped to the human genome (hg18) with a suffix array-based method that allows for residual primer trimming.  Sequencing yielded a total of 3.5 billion reads.','251255586816','ftp://climb.genomics.cn/pub/10.5524/100001_101000/100026/','Published','GigaDBUploadForm_Saqqaq.xls','fa84db683eee535029a52bbfc1322351','11/12/2011','05/31/2012','1');INSERT INTO dataset VALUES ('20','9','19','10.5524/100032','The genome of <em>Schistosoma haematobium</em>','<em>Schistosoma haematobium</em> is an important digenetic trematode, and is found in the Middle East, India, Portugal and Africa. It is a major agent of schistosomiasis. More specifically, it is associated with urinary schistosomiasis. Adults are found in the Venous plexuses around the urinary bladder and the released eggs traverse the wall of the bladder causing haematuria and fibrosis of the bladder. The bladder becomes calcified, and there is increased pressure on ureters and kidneys otherwise known as hydronephrosis. Inflammation of the genitals due to <em>S.haematobium</em> may contribute to the propagation of HIV. \n\nIn this study, we sequenced the <em>S.haematobium</em> genome from 200 ng of genomic DNA template isolated from a single, mated pair of adult worms, and produced 33.5 Gb of usable sequence data, using Illumina-based technology at 74-fold coverage and comparedit to sequences from related parasites. We consistently showed low sequence heterozygosity and estimated the genome size to be 431-452 Mb, then assembled the data and used local assemblies to close most (96.1%) of the remaining gaps, achieving a final assembly of 385 Mb (365 contigs; N50 scaffold size 307kb). Also we included genome annotation based on function, gene ontology, networking and pathway mapping. This genome now provides an unprecedented resource for many fundamental research areas and shows great promise for the design of new disease interventions.\n','365072220','ftp://climb.genomics.cn/pub/10.5524/100001_101000/100032/','Published','GigaDBUploadForm_Schistosoma.xls','a3ce9590de965ddfccc1e00af2be4b3a','04/19/2012','05/31/2012','1');INSERT INTO dataset VALUES ('21','10','20','10.5524/100023','Genome data from the sheep.','This is the first version of the draft sheep (<em>Ovis aries</em>) reference genome (OAR v2.0).\n\nA single Texel ewe and a single Texel ram were independently sequenced by next-generation sequencing platforms.  The genome was assembled using a similar method to that used for the first de novo assembled genome using only next-generation sequencing platforms, the giant panda.  However, here more paired-end libraries and longer insert libraries were used. Firstly, using SOAPdenovo, the 75X Texel ewe Illumina reads were assembled de novo into contigs and scaffolds.  Then, 120X Illumina sequence from both the Texel ewe (BGI) and ram (Roslin) was used for gap filling so as to improve the assembly.  At this point, the N50 length of contig was 18 kb, and the N50 length of the assembled scaffolds was 1.1Mb, achieving a total length of 2.71 Gb and covering ~93% of the expected ~3Gb length of the sheep genome.\n\nThe CHORI-243 BAC library end sequences were used to generate a set of super-scaffolds with an N50 of 37 Mb.  Then a high density RH map and a linkage map with 39,042 SNP makers (derived from the Ovine SNP50 BeadChip) were used to anchor the super-scaffolds to chromosomes.  Several rounds of manual checking and final error correction were carried out using the end sequences of the BACs in the bovine CHORI-243 library and 454 mate pair sequence data derived from 8kb and 20kb insert libraries of the male Texel (BCM).  Ambiguous positions were resolved using the predicted location of the SNPs based on OARv1.0 and conserved synteny with the UMD3 bovine genome assembly.  For the final release version, OAR v2.0, 95% (2.57 Gb) of the total scaffold sequence was placed onto the 26 autosomes and the X chromosome.','1503238553','ftp://climb.genomics.cn/pub/10.5524/100001_101000/100023/','Published','GigaDBUploadForm_Sheep.xls','3c3f24f5a1cdc2167afb95f29260b68e','11/12/2011','05/31/2012','1');INSERT INTO dataset VALUES ('22','1','21','10.5524/100024','Resequencing data from 40 varieties of wild and domesticated silkworms.','Here we present whole-genome resequencing data of 40 domesticated and wild silkworms (<em>Bombyx</em>).  The domesticated silkworm (<em>Bombyx mori</em>) is of great economic interest and has been domesticated for more the 5,000 years.  An organism with a mid-range genome size (~432 Mb), it often serves as a model insect for the order Lepidoptera.  A number of wild varieties of silkworms exist as well, including the Chinese wild silkworm (<em>Bombyx mandarina</em>) from which the domesticated silkworm originated.\n\nEach of the silkworm varieties was sequenced to ~3X coverage, representing 99.88% of the genome.  These sequences were then used to create a single-base pair resolution genetic variation map of the silkworm.  SNP sets were obtained separately for the pool of 29 domesticated strains and the pool of 11 wild varieties.  The number of SNPs in the domestic versus wild varieties was approximately 14 million and 13 million, respectively.  In addition to SNPs, approximately 0.33 million small insertion-deletions (indels) and 35 thousand structural variants (SVs) were identified among the 40 varieties.  Over three-fourths of the SVs overlapped with transposable elements.\n\nA total of 1,041 candidate regions Genomic Regions of Selective Signals (GROSS) were identified.  These regions cover 12.5 Mb (2.9%) of the genome and may reflect genomic footprints left by artificial selection during domestication, as they include 354 protein-coding genes that were identified as good candidates for domestication genes.\n\nWe observed that 159 genes from GROSS were expressed in on different B. mori tissues on day 3 of the fifth larval instar as a reference strain, and were enriched in tissues of silk gland, midgut, and testis.  The genes expressed in silk gland are involved in the synthesis of silk proteins, including fibroin and sericin.  Midgut-enriched genes are related to the metabolism of carbohydrates, amino acids and lipids.  And genes enriched in the testis are annotated as having binding, catalytic, and motor activity related to reproduction.\n\nThe reference genome for this project was the Japanese wild silkworm (NCBI Accession Number <a href="http://www.ncbi.nlm.nih.gov/nuccore/NC_003395">NC_003395</a>).','1331439861','ftp://climb.genomics.cn/pub/10.5524/100001_101000/100024/','Published','GigaDBUploadForm_Silkworm.xls','7259b7b2e6e1f29e7ddd230e4bc94cf0','11/12/2011','05/31/2012','1');INSERT INTO dataset VALUES ('23','14','27','10.5524/100014','DNA methylome of human peripheral blood mononuclear cells from the YH Han Chinese individual.','The methylome reported and analyzed here was generated from the same sample of peripheral blood mononuclear cells (PBMCs) from a consented donor (Homo sapiens) whose genome was deciphered in the <a href="http://yh.genomics.org.cn/">YH project</a>.  YH is an anonymous male Han Chinese individual who has no known genetic diseases, and whose genome also serves as an Asian reference genome.\n\nNuclear DNA was extracted and subjected to unbiased, whole-genome bisulfite sequencing (BS-seq) using the Illumina Genome Analyzer.  In total, 103.5 Gbp of paired-end sequence data were generated.  Of these, 70.4 Gbp (68%) were successfully aligned to either strand of the YH genome with an average mismatch rate of 1.3%, resulting in an average sequencing depth of 12.3-fold per DNA strand or a 24.7-fold overall depth.  Of the 18,962,679 CpGs present in the unique haploid part (2.21 Gb) of the YH reference genome sequence, approximately 99.86% were covered by at least one unambiguously mapped read of quality score >14 on either strand, and 92.62% were unambiguously covered on both strands.','114890375168','ftp://climb.genomics.cn/pub/10.5524/100001_101000/100014/','Published','GigaDBUploadForm_YHMethylome.xls','093f17678ee46637d7c97beaddffed8a','11/12/2011','05/31/2012','1');INSERT INTO dataset VALUES ('24','14','27','10.5524/100013','Transcriptome from a lymphoblastoid cell line taken from the YH Han Chinese individual. ','The transcriptome available here was generated from the same sample of peripheral blood mononuclear cells (PBMCs) from a consented donor (<em>Homo sapiens</em>) whose genome was deciphered in the <a href="http://yh.genomics.org.cn/">YH project</a>.  YH is an anonymous male Han Chinese individual who has no known genetic diseases, and whose genome also serves as an Asian reference genome.  These data were used to detect RNA-editing events using a pipeline that filtered and compared RNA-seq transcriptome and whole genome sequencing data (<a href=" http://dx.doi.org/10.1038/nbt.2122">doi:10.1038/nbt.2122</a>).\n\nRNA was extracted from viable lymphoblastoid cell line of the YH individual, treated with DNase I to remove residual DNA, and double-stranded cDNA was synthesized from these RNA samples using random hexamer-primer and reverse transcriptase.  For some of the libraries, samples were treated with Duplex-Specific thermostable nuclease (DSN) enzyme prior to cluster generation.\n\nSequencing libraries for strand specific transcriptome analysis were synthesized from fragmented RNA with random hexamer primers.  After purification to remove dNTPs, second-strand synthesis was performed.  Upon ligation with the Illumina PE adapters, the products were gel-recovered and subsequently digested with N-Glycosylase to remove the second-strand cDNA.  Samples were then amplified by 15 cycles of PCR with Phusion polymerase and PCR primers with barcode sequence.\n\nThe libraries were prepared based on the Illumina pair end library protocol and subsequently sequenced by the Illumina HiSeq 2000 platform.  Eight lanes of the flow cell were applied to the poly(A)+ RNA library, which was sequenced for 75 or 100 bp; five lanes were used for the poly(A)−  RNA library, which was sequenced for 90 bp.','78061030604','ftp://climb.genomics.cn/pub/10.5524/100001_101000/100013/','Published','GigaDBUploadForm_YHTranscriptome.xls','7b01466988a2899f9b2afe61439f1a80','11/12/2011','05/31/2012','1');INSERT INTO dataset VALUES ('25','13','22','10.5524/100027','Genome data from the Tibetan antelope (<em>Pantholops hodgsonii</em>). ','The Tibetan antelope (<em>Pantholops hodgsonii</em>) is a native of the high mountain steppes and semi-desert areas of the Tibetan plateau.  It is a medium sized antelope that displays both migratory and herd behavior.  Of interest, it is the only member of the genus <em>Pantholops</em>.  The Tibetan antelope are listed as an endangered species, which is due to commercial poaching for their fine underwool, competition with local domesticated herds, and commercial development of their range land.\n\nThe genome of the Tibetan antelope was sequenced using Illumina GA sequencing technology.  Genome assembly and annotation was also completed.  The data here can be used for understanding the unique adaptations this animal has for surviving in its extreme high-altitude and as a model for investigating specific genetic mechanisms and the biology of other ruminant species.','656056254464','ftp://climb.genomics.cn/pub/10.5524/100001_101000/100027/','Published','GigaDBUploadForm_Antelope.xls','7579d213cb1cef513583329fcbbf360f','11/12/2011','05/31/2012','1');INSERT INTO dataset VALUES ('26','14','27','10.5524/100015','Genome sequence of YH: the first diploid genome sequence of a Han Chinese individual.','Genomic data from the YH (<em>Homo sapiens</em>) genome – first diploid genome sequence of a Han Chinese, a representative of the Asian population.  The genomic DNA used in this study came from an anonymous male Han Chinese individual who has no known genetic diseases.\n\nThe YH genome was assembled based on 3.3 billion reads using the Illumina Genome Analyzer.  We achieved 117.7G nucleotides data and the genome was sequenced to 36-fold average coverage.  By aligning the short reads with SOAP, 102.9G nucleotides were mapped onto the NCBI reference genome and 99.97% of the genome was covered.  The raw sequences, aligments, consensus genome, variants and relevant tools are released for public use under a <a href="http://creativecommons.org/about/cc0">CC0 license</a>.','478888853504','ftp://climb.genomics.cn/pub/10.5524/100001_101000/100015/','Published','GigaDBUploadForm_YHGenome.xls','ce5467574283690cf7209dce87d7235f','07/06/2011','05/31/2012','1');INSERT INTO dataset VALUES ('27','11','23','10.5524/100012','Genome data from sweet and grain sorghum (<em>Sorghum bicolor</em>).','Sorghum is produced globally as a source of food, feed, fiber, and fuel.  Grain and sweet sorghums differ in a number of important traits including stem sugar and juice accumulation, plant height, and the production of grain and biomass.  The first sorghum whole-genome sequences are now available for analysis, but additional genomic sequences will be required to study genome-wide and intraspecific variation for dissecting the genetic basis of these important traits and for tailor-designed breeding of this important C4 crop.\n\nIn a joint effort with scientists from the Institute of Botany of Chinese Academy of Sciences (Beijing) and Temasek Life Sciences Laboratory (Singapore), BGI resequenced two sweet and one grain sorghum inbred lines: E-Tian, Ji2731, and Keller.  E-Tian (literally meaning Russian Sweet in Chinese) is a sweet sorghum line introduced into China in the early 1970’s. Ji2731 is a Chinese kaoliang grain sorghum that is well adapted to Northeast China.  Keller is an American-bred elite sweet sorghum line shown to perform well across a wide range of environmental conditions.\n\nUsing the re-sequencing data, a set of nearly 1,500 genes differentiating sweet and grain sorghum were identified.  These genes fall into 10 major metabolic pathways involved in sugar and starch metabolisms, lignin and coumarin biosynthesis, nucleic acid metabolism, stress responses and DNA damage repair.  In addition, 1,057,018 SNPs, 99,948 indels of 1-10bp in length and 16,487 presence/absence variations were uncovered, and 17,111 CNVs were detected.  The majority of the SNPs, large-effect SNPs, indels and presence/absence variations resided in genes containing leucine rich repeats, PPR repeats and disease resistance R genes possessing diverse biological functions or under diversifying selection, but were absent in genes which are essential for life.\n\nThis is the first publically available data that allows the identification of genome-wide patterns of genetic variation in sorghum.  The high-density SNP and indel markers presented here will be a valuable resource for future genotype and phenotype studies and the molecular breeding of this important crop and for related species.  ','27917287424','ftp://climb.genomics.cn/pub/10.5524/100001_101000/100012/','Published','GigaDBUploadForm_Sorghum.xls','3259ce08698c9e85a37c20dfc2045356','11/12/2011','05/31/2012','1');INSERT INTO dataset VALUES ('28','6','24','10.5524/100030','Genomic data from the Pacific oyster (<em>Crassostrea gigas</em>). ','The Pacific oyster (<em>Crassostrea gigas</em>) belongs to one of the most species-rich but genomically poorly explored phyla, the Mollusca.  In this study, DNA was extracted from an oyster derived from four generations of full-sib mating.  Short-reads and a fosmid-pooling  strategy were used for sequencing and assembly of the oyster genome.  DNA extracted from the inbred oyster and another wild oyster was used for resequencing analysis.  Finally, RNA-seq and small RNA from different organs at different developmental stages were extracted for developmental studies.','440234147840','ftp://climb.genomics.cn/pub/10.5524/100001_101000/100030/','HUP','GigaDBUploadForm_Oyster.xls','89caf198e7c4c867dc562e1e4e62a643','05/31/2012','05/31/2012','1');INSERT INTO dataset VALUES ('29','12','25','10.5524/100016','Genomic data from the potato. ','Available here is the genome of the potato (<em>Solanum tuberosum</em> L.), the first genome sequenced from the asterid clade.  Potato is a member of the Solanaceae, a plant family that includes many other economically important species, such as tomato, petunia, eggplant, tobacco, and pepper.  As the potato is both clonally propagated and the world;s most important non-grain food crop, its genome is a valuable agricultural resource.\n\nThe Potato Genome Sequencing Consortium sequenced two species: the heterozygous diploid <em>S. tuberosum</em> Group Tuberosum cultivar, RH89-039-16 (RH), and the doubled monoploid <em>S. tuberosum</em> Group Phureja clone DM1-3 516R44 (DM).  The potato genome consists of 12 chromosomes, of which over 80% of the homozygous clone’s 844-megabase genome were assembled.  Genome analysis revealed evidence of at least two genome duplication events and identified a number of asterid-specific genes.  Comparison between the two clones identified frequent gene variations and mutations, which may cause inbreeding depression.','501437431808','ftp://climb.genomics.cn/pub/10.5524/100001_101000/100016/','Published','GigaDBUploadForm_Potato.xls','eefc212f355c9a726deee98b0efa98e4','11/12/2011','05/31/2012','1');INSERT INTO dataset VALUES ('30','15','29','10.5524/100034','Hepatocellular carcinoma genomic data from the Asia Cancer Research Group.','Hepatocellular carcinoma (HCC) is one of the most common solid tumors worldwide and represents the third leading cause of cancer deaths.  Hepatitis B virus (HBV) is a major etiologic agent, leading to an increased risk of developing HCC, in particular those with acute liver disease and cirrhosis.  The Asian Cancer Research Group (ACRG) is an independent, not-for-profit company established to accelerate research and improve treatment for patients affected with the most commonly-diagnosed cancers in Asia.\n\nWith HBV being endemic in China and Southeast Asia, and high levels of HCC being a result, the ACRG have studied the events and effects of HBV integration in the HCC genome.  To do this massively parallel sequencing in a cohort of 88 Chinese patients diagnosed with HCC who underwent curative primary hepatectomy or liver transplantation at Queen Mary Hospital (Pokfulam, Hong Kong)was carried out.  All patients gave written informed consent to use both tumor (T) and non-tumor (N) liver tissues for the study.\n\nGenomic DNA was purified for at least 30-fold coverage paired-end (PE) sequencing, and PE reads were mapped on human reference genome (UCSC build hg19) and HBV (NC_003977).  Two sequencing libraries with different insert size were constructed for each genomic DNA sample (200bp and 800bp).  Paired end, 90bp read length sequencing was performed in the HiSeq 2000 sequencer according to Manufacturer’s instructions.  Raw gene expression profiling data of these human HCC samples has also deposited to GEO with the accession number GSE25097.','0','ftp://climb.genomics.cn/pub/10.5524/100001_101000/100034/','Published','GigaDBUploadForm_Cancer.xls','667d769e2016f2d1b84c002cfb72faf7','05/31/2012','05/31/2012','1');INSERT INTO dataset VALUES ('31','16','28','10.5524/100020','Genome data from foxtail millet (<em>Setaria italica</em>).','Foxtail millet (<em>Setaria italica</em>) (2n=18), is an annual grass grown both as cereal crop (grain production) and as forage food.  It is primarily grown in temperate, subtropical and tropical areas.  With approximately 6,000 varieties, millet is one member of the Panicoideae (grasses subfamily), which includes maize (<em>Zea mays</em>), sorghum (<em>Sorghum bicolor</em>), and sugar cane (<em>Saccharum officinarum</em>).  It is a nutritious dietary staple, containing starch, proteins, and a number of vitamins and minerals, such as calcium, iron, and sodium.  It feeds nearly one-third of the world population with main daily-calories intake, and is especially prevalent in dry climates or soil-poor regions that are not suited for the cultivation of many other crops.  Millet is self-pollinating, has a short lifecycle, is small in stature, and has a small genome size; all of these useful attributes make it an invaluable functional genomics model system, and an excellent reference genome to aid in the sequencing of other larger grasses genomes.','0','ftp://climb.genomics.cn/pub/10.5524/100001_101000/100020/','Published','GigaDBUploadForm_Millet.xls','353f30cb9508896179ac6bcaeb840b97','11/12/2011','05/31/2012','1');INSERT INTO dataset VALUES ('32','17','30','10.5524/100011','Genome data from the leaf-cutting ant (<em>Acromyrmex echinatior</em>). ','Here is presented high-quality (>100x depth) Illumina genome sequence of the leaf-cutting ant <em>Acromyrmex echinatior</em>, a model species for symbiosis and reproductive conflict studies.  They make a particularly good model as after humans, leaf-cutting ants form the largest and most complex animal societies on Earth.  Part of the subfamily Myrmicinae, this particular species is found in the wild from Mexico to Panama and subsists mostly on a particular fungus of the genus <em>Leucocoprinus</em>, which it cultivates on a medium of masticated leaf tissue.  With an estimated total size of 313 Mb, the genome is 28% made up of repeat sequences and has a GC content of 34%.','0','ftp://climb.genomics.cn/pub/10.5524/100001_101000/100011/','Published','GigaDBUploadForm_LeafCutterAnt.xls','e1dbf1dead0c45735fc49ff5db8a70f1','11/12/2011','05/31/2012','1');INSERT INTO manuscript VALUES ('1','10.1126/science.1211177','21940856','1');INSERT INTO manuscript VALUES ('2','10.1038/ng.919','21873998','3');INSERT INTO manuscript VALUES ('3','10.1038/nbt.1932','21804562','4');INSERT INTO manuscript VALUES ('4','10.1038/nbt.1992','22002653','6');INSERT INTO manuscript VALUES ('5','10.1159/000151320','18931490','7');INSERT INTO manuscript VALUES ('6','10.1038/ng.475','19881527','7');INSERT INTO manuscript VALUES ('7','10.1371/journal.pone.0005795','19495411','7');INSERT INTO manuscript VALUES ('8','10.1056/NEJMoa1107643','21793736','8');INSERT INTO manuscript VALUES ('9','10.1126/science.1192428','20798317','10');INSERT INTO manuscript VALUES ('10','10.1038/nature08696','20010809','13');INSERT INTO manuscript VALUES ('11','10.1038/nbt.2022','22057054','15');INSERT INTO manuscript VALUES ('12','10.1038/nature10553','22031327','18');INSERT INTO manuscript VALUES ('13','10.1038/nature08835','20148029','19');INSERT INTO manuscript VALUES ('14','10.1038/ng.1065','22246508','20');INSERT INTO manuscript VALUES ('15','10.1126/science.1176620','19713493','22');INSERT INTO manuscript VALUES ('16','10.1371/journal.pbio.1000533','21085693','23');INSERT INTO manuscript VALUES ('17','10.1038/nbt.2122','22327324','24');INSERT INTO manuscript VALUES ('18','10.1186/gb-2011-12-11-r114','22104744','27');INSERT INTO manuscript VALUES ('19','10.1038/nature10158','21743474','29');INSERT INTO manuscript VALUES ('20','10.1038/nature10533','21993625','16');INSERT INTO manuscript VALUES ('21','10.1038/nature07484','18987735','26');INSERT INTO manuscript VALUES ('22','10.1038/ng.2295','22634754','30');INSERT INTO manuscript VALUES ('23','10.1038/nbt.2195','22580950','31');INSERT INTO manuscript VALUES ('24','10.1101/gr.121392.111','21719571','32');INSERT INTO manuscript VALUES ('25','10.1038/nbt.1992','22002653','17');INSERT INTO manuscript VALUES ('26','10.1126/science.1192428','2